import React from 'react';
import AppLayout from '../components/AppLayout';

const Home = () => {
  const { isLoggedIn } = useSelector((state) => state.user);
  return (
    <AppLayout>
      <PostForm />
      <PostCard />
    </AppLayout>
  );
};

export default Home;
